'''Harald Normann''' (15 February 1893 &ndash; 18 June 1978 ) was a Norwegian military officer and non-fiction writer. He was born in [[Steinkjer]]. From 1936 he was in command of the [[Norwegian Army Air Service]]'s "jageving", and from 1939 he chaired the flying school at [[Kjeller]]. Among his books are ''Normalflyvning og snittflyvning'' from 1930, ''Luftkamp'' from 1934, ''Vollgraven'' from 1955, and ''Hvordan gikk det til?'' from 1962.<ref name=nbl>{{cite encyclopedia|title=Harald Normann |encyclopedia=[[Norsk biografisk leksikon]]|first=Ulf |last=Larsstuvold |authorlink= |editor=[[Knut Helle|Helle, Knut]]|publisher=Kunnskapsforlaget |location=Oslo |url=http://nbl.snl.no/Harald_Normann/utdypning |language=Norwegian |accessdate=10 October 2013}}</ref><ref name=snl>{{cite encyclopedia|title=Harald Normann |first= |last= |encyclopedia=[[Store norske leksikon]] |editor-last=Godal | editor-first=Anne Marit | editor-link=Anne Marit Godal |publisher=Norsk nettleksikon |location=Oslo |url=http://snl.no/Harald_Normann |language=Norwegian |accessdate=10 October 2013}}</ref>
